import styled from 'styled-components';

export const LoginWrapper =styled.div`
    z-index: 0;
    position:absolute;
    left:0;
    right:0;
    bottom:0;
    top:56px;
    background:#eee
`
export const LoginBox=styled.div`
    width:400px;
    height:180px;
    padding-top:20px;
    margin:100px auto;
    background:#fff;
    box-shadow: 0 0 8px rgba(0,0,0,.1);
    border-radius:10px;
`
export const Input=styled.input`
    display:block;
    width:200px;
    height:30px;
    line-height:30px;
    padding:0 10px;
    margin:10px auto;
    color:#777;
    border-radius:5px; 
`
export const Button=styled.div`
    width:220px;
    height:30px;
    line-height:30px;
    color:#fff;
    background:#3194d0;
    border-radius:15px;
    margin:30px auto;
    text-align:center;
`
